import styled from '@emotion/styled'
import Panel from './panel'
import Calendar from './calendar'

const Container = styled.div`
    max-width: 1170px;
    margin: 103px 30px auto 240px;
    padding: 0;
`

const Timetable = () => (
    <Container>
        <Panel />
        <Calendar />
    </Container>
)

export default Timetable;
